img_guide/spacer.gif" width="100%" height="10"></td><td width="2%"><img src="http://www.rakuten.ne.jp/gold/tokka-com/img/img_guide/spacer.gif" width="100%" height="10"></td><td width="15%"><img src="http://www.rakuten.ne.jp/gold/tokka-com/img/img_guide/spacer.gif" width="100%" height="10"></td></tr><tr><td colspan="11" width="100%"><img src="http://www.rakuten.ne.jp/gold/tokka-com/img/img_guide/spacer.gif" width="100%" height="20"></td></tr></table><table border="0" cellspacing="0" cellpadding="0" width="100%"><tr><td colspan="7" width="100%"><img src="http://www.rakuten.ne.jp/gold/tokka-com/img/img_guide/tlt_service.jpg" width="100%"></td></tr><tr><td colspan="7" width="100%"><img src="http://www.rakuten.ne.jp/gold/tokka-com/img/img_guide/spacer.gif" width="100%" height="20"></td></tr><tr><td width="23%"><img src="http://www.rakuten.ne.jp/gold/tokka-com/img/img_guide/btn_service01.jpg" width="100%"></td><td width="2%"><img src="http://www.rakuten.ne.jp/gold/tokka-com/img/img_guide/spacer.gif" width="100%" height="10"></td><td width="23%"><img src="http://www.rakuten.ne.jp/gold/tokka-com/img/img_guide/spacer.gif" width="100%" height="10"></td><td width="2%"><img src="http://www.rakuten.ne.jp/gold/tokka-com/img/img_guide/spacer.gif" width="100%" height="10"></td><td width="23%"><img src="http://www.rakuten.ne.jp/gold/tokka-com/img/img_guide/spacer.gif" width="100%" height="10"></td><td width="2%"><img src="http://www.rakuten.ne.jp/gold/tokka-com/img/img_guide/spacer.gif" width="100%" height="10"></td><td width="23%"><img src="http://www.rakuten.ne.jp/gold/tokka-com/img/img_guide/spacer.gif" width="100%" height="10"></td></tr><tr><td colspan="7" width="100%"><img src="http://www.rakuten.ne.jp/gold/tokka-com/img/img_guide/spacer.gif" width="100%" height="20"></td></tr></table><br>■今回付属のツールで簡単にアジャストが可能なバンドを採用し、装着感を向上。<br>■カレンダーのほか、ワールドタイムや時刻アラームなど便利な機能を搭載しています。<br>■また水泳や水仕事にも適した10気圧防水仕様になっています。<br>■ステンレス製の大型ベゼルがスポーティで上質な印象を演出。<br>■メタルバンド(ステンレススチール)<br>■ワンプッシュ3つ折式バックル<br>■ネオブライト<br>■樹脂ガラス(表面形状：球面･曲面)<br>■10気圧防水<br>■タフソーラー(ソーラー充電システム)<br>■電波受信機能：自動受信(最大6回/日)(中国電波は最大5回/日)/手動受信、<br>(日本)受信電波：JJY、周波数：40kHz /60kHz(福島/九州両局対応モデル)<br>(北米地域)受信電波：WWVB、周波数：60kHz<br>(ヨーロッパ地域)受信電波：MSF/DCF77、周波数：60kHz /77.5kHz<br>(中国)受信電波：BPC、周波数：68.5kHz<br>＊ホームタイム設定を受信可能な都市に設定すると、都市に合わせた局を受信します。尚、時差は選択した都市によって設定されます。<br>■ワールドタイム：世界29都市(29タイムゾーン、サマータイム設定機能付き)＋UTC(協定世界時)の時刻表示、ホームタイムの都市入替機能<br>■ストップウオッチ(1/20秒、24時間計、スプリット付き)<br>■タイマー(セット単位：1分、最大セット：24時間、1秒単位で計測、タイムアップ後経過時刻計測(24時間計)付き)<br>■時刻アラーム<br>■バッテリー充電警告機能<br>■パワーセービング機能(暗所では一定時間が経過すると運針を停止して節電します)<br>■日付･曜日表示<br>■フルオートカレンダー<br>■フル充電時からソーラー発電無しの状態での駆動時間<br>■機能使用の場合：約5ヵ月　<br>■パワーセービング状態の場合：約23ヵ月<br><br>■ホームタイム都市(受信機能対応都市) /受信電波<br>東京/日本の標準電波JJY40･JJY60<br>(ホノルル)、(アンカレジ)、ロサンゼルス、デンバー、シカゴ、ニューヨーク/アメリカの標準電波WWVB<br>ロンドン、パリ、アテネ/イギリスの標準電波MSF･ドイツの標準電波DCF77香港/中国の標準電波BPC<br>※(　)内の各都市は条件が良ければ受信する場合もあります。<br>※ 電波受信が行われない場合は、通常のクオーツ精度(平均月差±15秒)で動作します。<br>■サイズ(HxWxD)/質量：48.7x43.5x13.4mm/94g<br>■保証期間：メーカー保証1年【正規品】<br>■付属品：メーカーBOX　取扱説明書　保証書<br><br>〇ベルト調整につきまして<br>誠に申し訳ございませんが、ご購入いただきました腕時計のベルト調整は承っておりません。<br></font><br><font color=red><b>【正規品】</b></font>とは?<br>安心と信頼の国内メーカー(輸入時計は、正規代理店･特約店)からの<b>直接仕入れ</b></font>商品です。<br>ご購入時は、<b>メーカー保証</b></font>をお付けしております。<style type="text/css">
/*買い物カゴボタン*/
