	background:url("http://image.rakuten.co.jp/tokka-com/cabinet/img_btn/rt_cart_btn.gif") 0 0 no-repeat;
	width: 198px;
	height: 45px;
	border:none;
	margin-bottom: 10px;
	cursor: pointer;
	cursor: hand;
	text-indent:-9999px;
}
#rakutenLimitedId_aroundCart input[value="買い物かごに入れる"]:hover{
	opacity:0.8;  
	filter: alpha(opacity=80);  
	-ms-filter: "alpha( opacity=80 )";  
}
</style>

